import { Tile } from "../tile/Tile";

export const TileList = ({objects}) => {
  
  return (
    <div>
      <ul>
      {
         objects.map((object)=>{
          const {name}= object;
          const description= {name, ...object};
          console.log(object)   ;   
          <li> 
            <Tile
            name= {name}
            description= {description}
          > </Tile>
          </li> 
          
        })
      }
      </ul>
     
    </div>
  );
};
